# Create a function to check if one set is a superset of another 
def issuperset(superset, subset): 
    for item in subset: 
        if item not in superset: 
            return False
    return True

# Driver code 
superset = {1, 2, 3, 4, 5} 
subset = {2, 3, 5} 

# Check if superset contains subset or not 
if issuperset(superset, subset): 
    print("superset is a superset of subset") 
else: 
    print("superset is not a superset of subset")
